OUP: crd.projectcalico.org
apiVersion: #<string>
kind: #<string>
metadata: #<ObjectMeta>
  annotations: #<map[string]string>
  creationTimestamp: #<string>
  deletionGracePeriodSeconds: #<integer>
  deletionTimestamp: #<string>
  finalizers: #<[]string>
  generateName: #<string>
  generation: #<integer>
  labels: #<map[string]string>
  managedFields: #<[]ManagedFieldsEntry>
    apiVersion: #<string>
    fieldsType: #<string>
    fieldsV1: #<FieldsV1>
    manager: #<string>
    operation: #<string>
    subresource: #<string>
    time: #<string>
  name: #<string>
  namespace: #<string>
  ownerReferences: #<[]OwnerReference>
    apiVersion: #<string> -required-
    blockOwnerDeletion: #<boolean>
    controller: #<boolean>
    kind: #<string> -required-
    name: #<string> -required-
    uid: #<string> -required-
  resourceVersion: #<string>
  selfLink: #<string>
  uid: #<string>
spec: #<Object>
  exportV4: #<[]Object>
    action: #<string> -required-
    cidr: #<string>
    interface: #<string>
    matchOperator: #<string>
    prefixLength: #<Object>
      max: #<integer>
      min: #<integer>
    source: #<string>
  exportV6: #<[]Object>
    action: #<string> -required-
    cidr: #<string>
    interface: #<string>
    matchOperator: #<string>
    prefixLength: #<Object>
      max: #<integer>
      min: #<integer>
    source: #<string>
  importV4: #<[]Object>
    action: #<string> -required-
    cidr: #<string>
    interface: #<string>
    matchOperator: #<string>
    prefixLength: #<Object>
      max: #<integer>
      min: #<integer>
    source: #<string>
  importV6: #<[]Object>
    action: #<string> -required-
    cidr: #<string>
    interface: #<string>
    matchOperator: #<string>
    prefixLength: #<Object>
      max: #<integer>
      min: #<integer>
    source: #<string>
